import React from 'react';
import '../App.css';
import { AppBar } from '@material-ui/core';


class Header extends React.Component {
    constructor(props) {
        super(props)
    }


    render() {
        return (
          <div>
              <AppBar>
                  Hello there
              </AppBar>
          </div>
        );
    }
}

export default Header;
